import ExpenseItem from "./ExpenseItem";
const Expense=(props)=>{
    return(
        <>
      <ExpenseItem title={props.expenses[0].title} price={props.expenses[0].amount} date ={props.expenses[0].date} />
      <ExpenseItem title={props.expenses[1].title} price={props.expenses[1].amount} date ={props.expenses[1].date}/>
      <ExpenseItem title={props.expenses[2].title} price={props.expenses[2].amount} date ={props.expenses[2].date}/>
      <ExpenseItem title={props.expenses[3].title} price={props.expenses[3].amount} date ={props.expenses[3].date}/>
</>
)
}
export default Expense;
